use std::cmp::Reverse;
use std::collections::BinaryHeap;

impl Solution {
  pub fn min_moves(matrix: Vec<String>) -> i32 {
    let bb = matrix
      .iter()
      .map(|m| m.as_bytes().to_vec())
      .collect::<Vec<Vec<u8>>>();
    let mut letter: Vec<Vec<(usize, usize)>> = vec![vec![]; 26];
    for row in 0..matrix.len() {
      for col in 0..matrix[0].len() {
        if bb[row][col] >= b'A' && bb[row][col] <= b'Z' {
          letter[(bb[row][col] - b'A') as usize].push((row, col));
        }
      }
    }
    let mut steps: Vec<Vec<i32>> = vec![vec![i32::MAX; bb[0].len()]; bb.len()];
    steps[0][0] = 0;

    let mut bh: BinaryHeap<(Reverse<i32>, usize, usize)> = BinaryHeap::new();
    bh.push((Reverse(0), 0, 0));
    if bb[0][0] >= b'A' && bb[0][0] <= b'Z' {
      for next in &letter[(bb[0][0] - b'A') as usize] {
        if steps[next.0][next.1] > 0 {
          steps[next.0][next.1] = 0;
          bh.push((Reverse(0), next.0, next.1));
        }
      }
      letter[(bb[0][0] - b'A') as usize] = vec![];
    }
    while bh.len() > 0 {
      let (rs, r, c) = bh.pop().unwrap();
      let step = rs.0;
      if r == bb.len() - 1 && c == bb[0].len() - 1 {
        return step;
      }

      for cord in vec![(-1, 0), (1, 0), (0, -1), (0, 1)] {
        let nr = r as i32 + cord.0;
        let nc = c as i32 + cord.1;
        if nr < 0 || nr >= bb.len() as i32 || nc < 0 || nc >= bb[0].len() as i32 {
          continue;
        }

        let nr = nr as usize;
        let nc = nc as usize;
        if bb[nr][nc] == b'#' {
          continue;
        }

        if step + 1 < steps[nr][nc] {
          steps[nr][nc] = step + 1;
          bh.push((Reverse(step + 1), nr, nc));
          if bb[nr][nc] >= b'A' && bb[nr][nc] <= b'Z' {
            for next in &letter[(bb[nr][nc] - b'A') as usize] {
              if steps[next.0][next.1] > step {
                steps[next.0][next.1] = step;
                bh.push((Reverse(step + 1), next.0, next.1));
              }
            }
            letter[(bb[nr][nc] - b'A') as usize] = vec![];
          }
        }
      }
    }
    -1
  }
}

